import React from 'react';
import { Box, Typography } from '@mui/material';

export default function Chat() {
    return (
        <Box sx={{ display: 'flex', flexDirection: 'column', height: '100%' }}>
            <Box sx={{ flexGrow: 1, overflow: 'auto' }}>
                {/* Chat messages */}
            </Box>
            <Box sx={{ p: 2 }}>
                {/* Chat input */}
            </Box>
        </Box>
    );
};
